import React from "react";


class Products extends React.Component {

    render() { 
        return (
            <main className="container">
                <span>{this.props.products.name} = </span>
                <span>{this.props.products.count}  </span>
                <button className="btn btn-primary m-2 " onClick={()=>this.props.onDelete(this.props.product)}>Delete</button>
            </main>
        );
    }
}

export default Products;
